function DevKeyData() {
    return (
        <>
            <main className="h-screen flex justify-center p-10">
                <div className="rounded-md grid grid-cols-2 gap-3 w-full">
                    <KeyData />
                </div>
            </main>
        </>
    )
}

export default DevKeyData
